import React, { Component } from "react";
import { Typography } from "@material-ui/core";
import HeaderImg from "../assets/_DSC5675.jpg";
import "./Home.css"






export default class Home extends Component {

  render() {
    return (
        <div className="home-content">
            <div className="home-right">
                <img className="home-headerImg" src={HeaderImg} />
            </div>
            <div className="home-left">
                <Typography variant="title">
                    A fresher way to clean your home
                </Typography>
                <Typography variant="body1">
                    Organic and non-toxic cleaning products for a clean and chemical free finish.
                </Typography>
            </div>
        </div>

    );
  }

}
